css:
.nuclide-ui-message {
  border: 1px solid #dbdbdc;
  border-radius: 3px;
  margin: 5px;
  padding: 10px;
  border-left-width: 5px;
  line-height: 2;
}
.nuclide-ui-message-default {
  border-color: #8e8e90;
}
.nuclide-ui-message-error {
  color: #f42a2a;
  border-color: #f42a2a;
}
.nuclide-ui-message-info {
  color: #1492ff;
  border-color: #1492ff;
}
.nuclide-ui-message-success {
  color: #2db448;
  border-color: #2db448;
}
.nuclide-ui-message-warning {
  color: #d5880b;
  border-color: #d5880b;
}
